export function sumVersions(versions: VersionDatum[]) {
  return versions.map(v => ({
    date: v.date,
    both: Object.fromEntries(
      Object.entries(v['next-usequerystate'])
        .map(
          ([version, downloads]) =>
            [version, downloads + (v.nuqs[version] ?? 0)] as const
        )
        .sort(([, a], [, b]) => b - a)
    )
  }))
}

